pub enum RecoverPubkeyError {
    InvalidHashFormat,
    InvalidSignatureFormat,
    InvalidRecoveryParam,
    UnknownErr {
        error_code: u32,
    },
}

pub enum StdError {
    VerificationErr {
        source: VerificationError,
    },
    RecoverPubkeyErr {
        source: RecoverPubkeyError,
    },
    GenericErr {
        msg: String,
    },
    InvalidBase64 {
        msg: String,
    },
    InvalidDataSize {
        expected: u64,
        actual: u64,
    },
    InvalidUtf8 {
        msg: String,
    },
    NotFound {
        kind: String,
    },
    ParseErr {
        target_type: String,
        msg: String,
    },
    SerializeErr {
        source_type: String,
        msg: String,
    },
    Overflow {
        source: OverflowError,
    },
    DivideByZero {
        source: DivideByZeroError,
    },
    ConversionOverflow {
        source: ConversionOverflowError,
    },
}

pub enum SystemError {
    InvalidRequest {
        error: String,
        request: Binary,
    },
    InvalidResponse {
        error: String,
        response: Binary,
    },
    NoSuchContract {
        addr: String,
    },
    Unknown {
    },
    UnsupportedRequest {
        kind: String,
    },
}

pub enum VerificationError {
    BatchErr,
    GenericErr,
    InvalidHashFormat,
    InvalidSignatureFormat,
    InvalidPubkeyFormat,
    InvalidRecoveryParam,
    UnknownErr {
        error_code: u32,
    },
}

pub enum BankQuery {
    Balance {
        address: String,
        denom: String,
    },
    AllBalances {
        address: String,
    },
}

pub enum WasmQuery {
    Smart {
        contract_addr: String,
        msg: Binary,
    },
    Raw {
        contract_addr: String,
        key: Binary,
    },
    ContractInfo {
        contract_addr: String,
    },
}

pub enum BankMsg {
    Send {
        to_address: String,
        amount: Vec<Coin>,
    },
    Burn {
        amount: Vec<Coin>,
    },
}

pub enum WasmMsg {
    Execute {
        contract_addr: String,
        msg: Binary,
        funds: Vec<Coin>,
    },
    Instantiate {
        admin: Option<String>,
        code_id: u64,
        msg: Binary,
        funds: Vec<Coin>,
        label: String,
    },
    Migrate {
        contract_addr: String,
        new_code_id: u64,
        msg: Binary,
    },
    UpdateAdmin {
        contract_addr: String,
        admin: String,
    },
    ClearAdmin {
        contract_addr: String,
    },
}
